import './App.css';
import Form from './components/Form';
import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      resume: {},
    };
  }

  renderResume = (resume) => {
    this.setState({resume: {resume}})
  }

  render() {
    return (
      <Form />
    );
  }

}

export default App;
